import React from "react";
import { Navbar } from "rbx";

// impontainer } from './styles';

function Nav() {
  return (
    <Navbar>
      <Navbar.Brand>
        <Navbar.Item href="https://bulma.io">
          <h2>Covid</h2>
        </Navbar.Item>
        <Navbar.Item>Agendamentos</Navbar.Item>
        <Navbar.Item>Enfermeiro</Navbar.Item>
        <Navbar.Burger />
      </Navbar.Brand>
    </Navbar>
  );
}

export default Nav;
